  return (
    <nav className='w-full flex py-6 justify-between items-left navbar text-white' >

<h1 className='font-kenia text-4xl'>Neemat.Design</h1>

<ul>
  {navLinks.map}
</ul>
      </nav>
  )
}

export default Navbar;
